INSERT INTO `tbl_products` VALUES (1280,'9301a18d-cdfb-7871-30d4-2a9cfbfc5bd2',37,'מיניספיקר בלות\' דגם: רדיוהד','מיניספיקר רמקול בלוט\' נייד\r\nתצוגה דיגיטלית, תאורת לד מתחלפת\r\n\r\n3.7V 1200mA\r\nמידות 4\"*2','1646056092-8a9598af-c547-5b66-0260-af4c03ed58fa.jpg',80,120,'שנה','[]','2022-02-28 15:48:12','2022-02-28 20:15:34'),(1281,'7dbc39dd-7730-7b74-5cf7-b43989287fcb',37,'מערכת שמע עוצמתית דגם: מטליק','מערכת שמע עוצמתית, בעלת כל החיבורים החכמים: BLUT,AUX,USB,SD וכו..\r\nהמערכת בעלת צג דיגיטלי ובורר עוצמה מעגלי.\r\nבנוסף תקבלו: \r\n- שלט רחוק.\r\n- מקרופון חוטי.\r\n-תאורת לד מגניבה.','1646056092-c735465d-3eaa-09c1-b3d7-6e89dbefd849.jpg',150,199,'שנה','[\"1646056092-ae3a2de0-7df1-7b18-c9d8-8644d0a594e6.jpg\",\"1646056092-175402d2-b894-0290-f682-feed2145ab10.jpg\"]','2022-02-28 15:48:12','2022-02-28 20:14:08'),(1282,'616afbb5-ade8-d519-d4d8-da944cfb2c68',37,'מיניספיקר - שעון big ban','בלות\', צג דיגיטלי ושעון מעורר\r\n\r\nכולל את כל הכניסות החכמות AUX, USB וכו\'.\r\n\r\nרמת שמע MP3.','1646056092-322b3b8d-8c59-9a33-45cc-6574110776a4.jpg',50,100,'שנה','[\"1646056092-186b7a41-36e5-334f-3ebe-c5d4c7e04a68.jpg\",\"1646056092-8ca57c00-e5ad-8ebe-a6d9-fca92b308ca1.jpg\",\"1646056092-622427f7-ceba-0a94-799f-58156c913619.jpg\",\"1646056092-0e1cfeda-6b71-6756-6a9e-c2a002d7d478.jpg\",\"1646056092-54efbd5a-9a99-653b-449e-a2f2f261bb4f.jpg\"]','2022-02-28 15:48:12','2022-02-28 20:09:04'),(1283,'3c55354e-66d4-b9ac-8651-a16ccfba4150',34,'מיוזיק בוקס מנורה-הילה','מערכת שמע בלוטוס ופוואר-בנק 4000/MAH\r\n\r\nכולל כניסת USB וכרטיס זיכרון\r\n\r\nאפשרות ל 3 עוצמות תאורה בבסיס הנורה\r\n\r\nניתן להחליף את צבעי הבסיס על ידי מגע בחיישן התאורה (הנמצא במרכז הנורה) – טאץ\'\r\n\r\n35 נורות לד','1646056092-437feda9-e572-c409-140c-601b3f4f71ac.jpg',50,100,'שנה','[\"1646056092-1598df94-91a7-c304-ef0a-260bc6092834.jpg\",\"1646056092-ae3bc933-5228-e718-3481-bbdcd51a8e1f.jpg\",\"1646056092-a9cb2ac8-17d0-097c-aa23-dc36aeeaefa7.jpg\"]','2022-02-28 15:48:12','2022-02-28 20:07:31'),(1284,'4cb19492-5145-5271-9db9-08b2b72e8fd5',37,'מערכת שמע עוצמתית דגם queen','מערכת שמע עוצמתית\', אלחוטית עם ידית מתקפלת ארגונומית לנשיאה בקלות וביעילות.\r\nבעלת כל החיבורים החכמים כולל אפשרות חיבור למיקרופון נייד. בעלת אפשרויות נרחבות לשליטה בסאונד.\r\nמאפיינים:\r\n- צג דיגיטלי.\r\n- פלטת שליטה בסאונד.\r\n- אפשרות לחיבור מיקרופון נייד.\r\n- חיבור למיקסר חיצוני.','1646573998-58047e3e-37d5-afeb-0b06-6f6a8d497cb7.jpeg',350,450,'שנה','[\"1646573994-c5f0d667-3401-071d-f25c-0dc516f29e28.jpeg\"]','2022-02-28 15:48:13','2022-08-22 14:09:54'),(1285,'154db77f-9876-8f85-a98d-b4715a2a74ae',37,'מיניספיקר בלות\' דגם: mohar','כולל תאורת לד\r\nחיבורי FM / MIC / USB / TF / AUX\r\nסוללה נטענת מובנית\r\nסוללה: 3.7V 1500mAh','1646056093-49ace566-d442-4123-b5ff-6a33444be434.jpg',50,100,'שנה','[\"1646056093-1913442b-2044-1136-1edd-18b31859dacc.jpg\"]','2022-02-28 15:48:13','2022-02-28 20:01:17'),(1286,'305b247b-bbf4-4c0e-a076-6266e1725e94',36,'מארז 5 מגבות גוף דגם עדן','מגבות 100% כותנה בעלות מגע קטיפתי ונעים.\r\nמידות 140*70\r\n\r\n550 גרם','1646056093-220b43c1-1b92-612e-d8ea-44c29a0f3aaa.png',100,145,'שנה','[\"1646056093-1fba501b-6b11-f0eb-bafc-3fe4de41fe5d.jpg\"]','2022-02-28 15:48:13','2022-02-28 19:59:21'),(1287,'7f96dbd0-c879-a24e-eb41-03bffbdb6d1c',36,'מארז 4 מגבות פנים דגם: חרצית','מארז מהודר בצלופן.\r\n\r\nמכיל 4 מגבות פנים איכותיות במידות 30X70','1646056093-f314da05-c2ab-6975-a789-0d5df2b1af0c.jpg',50,70,'שנה','[]','2022-02-28 15:48:13','2022-02-28 19:57:08'),(1288,'30c18839-22bb-12b4-7813-ca1ed4cdbe06',36,'סט 5 מגבות פנים דגם תמר','מארז 5 מגבות פנים איכותיות במידות 30X70\r\n\r\nגוונים שונים לבחירה','1646056093-98557061-a249-dfa4-87ab-d70054ef17b4.jpg',100,150,'שנה','[\"1646056093-c1460c90-2c5e-3a72-9347-ead83d825173.jpg\"]','2022-02-28 15:48:13','2022-02-28 19:56:15'),(1289,'a772193b-2496-8b04-4552-42dd89220c33',36,'מגבת גוף דגם שקד','מידות 140*70\r\n\r\n650 גרם\r\n\r\n100% כותנה\r\nמגוון צבעים לבחירה','1646056093-b084da0b-07b9-24f0-a237-0a11d006d76f.jpg',35,55,'שנה','[]','2022-02-28 15:48:13','202