, מצקת, כף הגשה, תרוד וכף לפסטה.','1646056094-8d0f7688-84b9-ced4-fa5e-739f816ded10.png',35,45,'שנה','[]','2022-02-28 15:48:14','2022-02-28 19:49:34'),(1295,'30818497-8a65-fb85-bd6a-fc58cf3225e2',35,'סט למטבח דגם: שרי','סט דגם \'שרי\' עשוי פלסטיק קשיח הכולל:\r\nקערת סלט, כפות הגשה, 4 קעריות סלט אישיות במגוון צבעים, מסחטת פירות הדר עם ראש מתחלף לסחיטת פירות גדולים.','1646056094-95ed5406-e01e-3506-6660-c4e51356cfd4.png',55,90,'שנה','[\"1646056094-2911a037-5962-22ee-f0d3-86ab91f56373.jpg\",\"1646056094-63b696bd-a7c4-a222-1132-036a26654fea.jpg\",\"1646056094-32e116d1-baa8-66cb-832e-f03fcafb3096.jpg\",\"1646056094-fc39d3c3-3f50-ff51-e76e-0c31853f5bfc.jpg\",\"1646056094-9f3cda37-b5c2-9834-7475-072156533396.jpg\"]','2022-02-28 15:48:14','2022-02-28 19:48:53'),(1296,'c7a28bc7-3bba-ad6b-f194-f47c34b69ccc',35,'סט סכיני שף ומשחיז דגם מאסטר שף','סט סכינים, דגם מאסטר שף מבית Perito moreno. סט 4 חלקים, 3 סכיני שף איכותיים בעלי ידיות אחיזה ארגונומיות. הסכינים עשויים פלדת אל חלד 18/10. הערכה כוללת סכין שף, סכין סנטוקו, סכין ירקות ומשחיז מקצועי.\r\n\r\nמפרט טכני:\r\n\r\nסכין שף 20 ס\"מ.\r\nסכין סנטוקו 17ס\"מ.\r\nסכין ירקות: 13ס\"מ.\r\nפלדת אל חלד 18/10.','1646056094-ef288982-3c59-0f7b-7388-9f5ac2f038c6.png',150,225,'שנה','[\"1660492391-e1e77519-093f-e7b6-dbfd-9e932d26ace5.jpg\",\"1660492395-007bafb2-83bc-a613-7dde-4ea73b3f139d.jpg\"]','2022-02-28 15:48:15','2022-08-14 18:53:18'),(1297,'ef556df0-749c-338d-287e-4594f4d29854',34,'מעבד מזון kenwood - דגם: fdp304wh','מנוע 800 וואט לביצועים אופטימאליים, 2 מהירויות + פולס לשימושים שונים ומגוונים.\r\nנפח קערה 2.1 ליטר\r\nקיבולת עבודה 1.2 ליטר\r\nסכין לערבול וקיצוץ מפלדת אל-חלד\r\nדסקית עבה + דסקית דקה, אביזר ללישה, מקציף לביצים, שמנות וכו\'..\r\nניתן לשטוף במדיח כלים.\r\nרגלי גומי ליציבות בעבודה.\r\nמקום לאחסון הכבל.','1646056095-6eee2c86-aa2a-18ad-03d3-6a9d04494f9e.jpg',350,415,'שנה','[]','2022-02-28 15:48:15','2022-02-28 19:43:26'),(1298,'4e3e6a37-270d-37f9-eafa-b06308fed8c9',34,'בלנדר ספורט kenwood - \'דגם bl-237wg\'','בלנדר ליצירת תערובות עשירות ,מזינות ,טעימות, טריות ובריאות.\r\nקל לנשיאה ובטוח לנסיעות\r\n\r\n בלנדר פונקציונאלי 3 ב-1.\r\nעוצמת מנוע 350 וואט.\r\nמיכל 1 ליטר.\r\nעיצוב קומפקטי\r\nפיה נוחה למזיגה ללא מאמץ.\r\n2 מהירויות + פולס.\r\nמטחנה לקיצוץ אגוזים ,עשבי תיבול וקפה .\r\nכוס עבור כמות גדולה להכנת תערובת בריאה ומהנה.\r\nכוס מיוחדת ושימושית לבית ולנסיעות 450 מ\"ל עם מכסה מיוחד ונוח .\r\nניתן לשטוף במדיח כלים.\r\nמידות: גובה: 31.5 ס\"מ, רוחב: 15 ס\"מ, אורך: 17.0 ס\"מ.\r\nמשקל: 1.5  ק\"ג.\r\nגוון: שילוב לבן ירוק','1646056095-6a6ba92b-368d-25c8-2d6c-67b664016e7b.jpg',185,230,'שנה','[\"1646056095-a49ca867-f91c-b752-0000-49fb84a79090.jpg\",\"1646056095-788ada05-587c-2de0-6002-940f88468da4.jpg\",\"1646056095-ecc5ad61-1cf9-6fbe-37eb-5cbc936104d0.jpg\"]','2022-02-28 15:48:15','2022-02-28 19:40:40'),(1299,'c29dd8d3-c992-1efd-109f-8241b106fa78',34,'קוצץ חשמלי 400w דגם \'ספרטה\'','קוצץ חשמלי איכותי וחזק מבית Perito moreno, דגם GX – 501. חותך, קוצץ ומערבב עוצמתי בעל 4 להבים לשימוש קל ומהיר לחיתוך כל סוגי הבשר, ירקות, פירות, עישבי תיבול, גבינות, מאכלי תינוקות, תבלינים ומשקאות. להבים עשויים פלדת אל חלד. כפתור הפעלה ארגונומי. \r\n\r\nתוספות מיוחדות: אופציה להפריד להבים ולהשתמש בשניים מתוך הארבע\r\n\r\nמפרט טכני:\r\n\r\n4 להבים עשויים פלדת אל חלד.\r\nמיכל ערבול עשוי פלסטיק חזק 500ML מתאים לשטיפה במדיח. \r\nהספק 400 W. \r\n2 מהירויות.\r\nמשטח למניעת החלקה.','1646056095-8b142b4c-d3ef-4d82-b6b1-82e60bf209a7.png',135,179,'שנה','[\"1660492421-c43fafbd-09be-d2cf-d64d-4f0d56569537.jpg\",\"1660492423-4ef7401a-d4b8-e586-91ad-bc7d738c6ec4.jpg\"]','2022-02-28 15:48:15','2022-08-14 18:53:48'),(1300,'de9007ee-9f1c-2622-0c39-e3272a031bd0',34,'בלנדר ספורט kenwood - \'דגם smp-060wg\'','דגםSMP-060WG \r\nעוצמת מנוע 300 וואט.\r\n2 בקבוקי ספורט 0.6 ליטר כל אחד.\r\nבקבוק פלסטיק גמיש.\r\nמכסה למיכל שניתן לשתות בנוחות מרבית.\r\nפיה נוחה למזיגה ללא מאמץ.\r\n2 תוכניות  להשגת תוצאה מושלמת.\r\nגומיות בתחתית למניעת החלקה.\r\nניתן לשטוף במדיח כלים.\r\nמידות: גובה: 36 ס\"מ, רוחב: 14.5 ס\"מ, אורך: 14.5 ס\"מ.\r\nמשקל: 1.5 ק\"ג.\r\nגוון: לבן/ירוק.','1646056095-590d63e7-26da-781e-ecf2-74e36d25c47a.jpg',185,225,'שנה','[]','2022-02-28 15:48:15','2022-02-28 19:14:12'),(1301,'65fbf010-5f93-c2a2-5e9c-01bcacb959e6',34,'סט קוצץ, בלנדר מוט ומערבל ידני graetz \'דגם gr-792\'','מערבל יד\r\nקוצץ מיני מהיר\r\nמוט בלנדר\r\nמערבל יד:\r\nהספק 150 וואט,\r\n5 מהירויות הפעלה,\r\n2 זוגות מערבלים ללישה והקצפה.\r\n\r\nקוצץ מיני מהיר :\r\nהספק : 200 וואט, מנוע חזק.\r\nהפעלה בלחיצה אחת.\r\nמיועד לקיצוץ, ריסוק ועיבוד מזון, ירקות, פירות, גבינות, עשבי תיבול, בצל,\r\nפטרוזיליה, אגוזים, שקדים וכד\'. אידיאלי להכנת רטבים/ טחינה.\r\nגוון: אפור / לבן\r\n\r\nמוט בלנדר:\r\nהספק: 180 ואט\r\nמגוון אפשרויות: ריסוק, קיצוץ ועוד\r\nמתאים להכנת מזון לתינוקות: מרקים, רטבים, מחיות, מיצים, שייקים ועוד\r\nמבנה ארגונומי לאחיזה נוחה','1646056095-7ffa5522-f1de-ed4c-a6be-27541a004775.jpg',225,276,'שנה','[\"1646056095-4913de41-5f60-e479-ad79-b5ef90ab2374.jpg\"]','2022-02-28 15:48:15','2022-02-28 19:11:54'),(1302,'d089cf61-74ad-f451-41ff-85f74daad160',34,'מאוורר ללא להבים','מאוורר ללא להבים – בטיחותי בפני ילדים\r\nמתכוונן ופועל על ידי שלט\r\n180 מעלות בנוסף על ציר בסיס (למטה/למעלה)\r\nבעל 10 מצבי מהירות + טיימר\r\nצידוד חשמלי ימין ושמאל צידוד ידני כלפי מעלה ומטה\r\nבעל אישור מכון התקנים הישראלי\r\nניתן לפירוק והרכבה בקלות\r\nקל לניקוי','1646056095-09f0d199-b6a3-fbfb-7c54-757188f91851.png',150,250,'שנה','[\"1646056095-96f9bf9c-d6f3-2f7c-6d56-cae8760993e1.png\",\"1646056095-30f10bfe-d201-eeca-1c7e-ed1b1ca6d799.png\",\"1646056095-8f5b1206-5a31-c0cc-6b1c-9c92354f3704.png\"]','2022-02-28 15:48:15','2022-02-28 19:08:05'),(1303,'bc968636-f718-2ca9-1754-6f6a14461ac1',37,'מזוודת sumith swiss','מזוודת עלייה למטוס 21\r\nתא קדמי נפתח בחלקו העליון לנוחות מירבית\r\nמנעול מובנה.\r\n\r\n','1646056096-c45713df-a3d6-df06-2934-210c59b641d6.png',160,239,'שנה','[\"1646056096-ef560036-d0f7-c4ff-ddfe-2dc555049afd.png\",\"1646056096-e6a24fca-25ee-25d8-4345-615994d229ca.png\"]','2022-02-28 15:48:16','2022-02-28 19:06:10'),(1304,'1175d1d3-cb46-c06e-ecc7-f8d08f85b443',37,'