לשחרור מים מהצידנית,\r\nזוג גלגלים חזקים ונוחים לשינוע גם על אדמת חצץ.\r\n\r\nצידנית אישית, נפח 8 ליטר\r\nמתאים לשמירה על מזון קר או חם.\r\nעם ידית נשיאה.\r\n\r\nמיכל שתיה 2.2 ליטר\r\nמיכל למים קרים, בידוד מוחלט. פיה נשלפת למזיגה קלה. עם ידית נשיאה מחוזקת, ציפוי פנימי עמיד בפני ריחות וכתמים, מכסה עליון עם הברגה, לשטיפה וייבוש מהיר.','1660211411-06864f4d-6306-c589-2a69-6ec34739766d.png',350,440,'שנה','[\"1660211394-dbd8be27-8044-df53-bb74-9db2096adefe.png\"]','2022-08-11 12:50:11','2022-08-22 14:53:20'),(1403,'93e5a68b-c806-37e3-b345-08b055c971e6',35,'סט סירים יציקת אלומיניום 5 חלקים prisma סולתם','הסט כלל:\r\nסיר 20 ס\"מ (ורוד בהיר)\r\nסיר 24 ס\"מ (ורוד פוקסיה)\r\nמחבת 24 ס\"מ (סגול בהיר)','1660463992-6af31edc-668f-1e55-0803-c7c3c58c2100.jpg',330,440,'שווי החלפה: 1,209','[]','2022-08-14 10:59:52','2022-08-14 11:48:32'),(1404,'f1912821-7e78-b143-e11b-41abc8afd57d',35,'סט סירים 9 חלקים richstone שיש זהב וכסף xl יציקת אלומיניום סולתם','הסט כלל:\r\nמחבת 28 ס\"מ.\r\nסיר ס4 ס\"מ.\r\nסיר 28 ס\"מ.\r\nכף ניילון.\r\nתרווד ניילון.\r\nמטחנה חשמלית שחורה.\r\nתחתית סיליקון לסיר חם.\r\n','1660464250-561a9a63-4121-cc0d-df98-bae1789a5de2.jpg',350,440,'שווי החלפה: 1,649','[]','2022-08-14 11:04:10','2022-08-14 11:48:14'),(1405,'da3a3258-a553-c0f9-2e52-e57a2af43ee3',34,'פח אשפה לחיצה מעוצב chromex','פח אשפה לחיצה מעוצב, נפח 45 ליטר, גימור שמשתלב בכל חלל בבית.','1660464692-e4138ed2-ddc3-f8f8-4b24-cdf999a14eb9.jpeg',350,440,'שנה','[]','2022-08-14 11:11:32','2022-08-14 11:11:38'),(1406,'f6f6963d-48bd-4a9b-b26f-fe094ee87b28',36,'זוג מגבות מטבח מהודרות vardinon','זוג מגבות מטבח מהודרות 60*40סמ שחור כותנה %100','1660465811-eb7eed37-0390-9401-7cf5-f13bc8ddb080.png',100,150,'שווי החלפה 1590 שח ','[]','2022-08-14 11:30:11','2022-08-14 11:30:17'),(1407,'19104e9f-c540-e127-ce9c-58db96c86a7c',35,'בלנדר מוט מנירוסטה braun','בלנדר מוט מנירוסטה \r\nמכל לעיבוד מזון בנפח 1.5 ליטר אביזר מיוחד להכנת בצק \r\n21 מהירויות בקרת ביצועים ביד אחת \r\n כוס מדידה 600 מ\"ל\r\nבקר שליטה למהירויות \r\nהספק 1000 וואט','1660466185-3b6203b7-76ac-27d6-2219-c937885de590.jpg',390,440,'שנה','[]','2022-08-14 11:36:25','2022-08-14 11:36:31'),(1408,'0eae8062-69d1-4105-b601-16af240314b2',42,'תו הזהב','תו הזהב של שופרסל בשווי 400 ש\"ח \r\nמגוון חנויות ומותגים למימוש','1660482361-0d7627df-587f-f4b9-3ab2-e0d4b81947c4.jpg',378,440,NULL,'[\"1660482352-91766ea4-5bea-6806-fef7-66314745cb38.jpg\"]','2022-08-14 16:06:01','2022-08-25 12:51:17'),(1409,'fefffd54-4390-0241-6dd8-af4e39bcf522',35,'סט סירים 3 חל\' cube סולתם','כלי הבישול מסדרת Cube מיוצרים מאלומיניום, בתהליך Forged ההופך אותם לחזקים ועמידים במיוחד, בעלי מראה עכשווי נוחים לשימוש וקלים לניקוי.\r\nציפוי NON STICK איכותי בגימור שיש. הציפוי מונע הידבקות ללא PFOA, קדמיום, או עופרת. ידידותי לסביבה, מסייעים לשמירה על הבריאות – מיועדים לשימוש מופחת בשמן.\r\n\r\nגוף האלומיניום מבטיח חלוקת חום שווה ויעילה, לקבלת תוצאות בישול מרביות וחסכון בזמן ואנרגיה.\r\n\r\nלסירים מכסה חסין חום מזכוכית שקופה, עם חריר לשחרור אדים למעקב אחר התקדמות תהליך הבישול ללא צורך בהרמת המכסה, מסביב למכסה טבעת סיליקון עבה, לאיטום מיטבי ולשמירה על ציפוי ה Non Stick.\r\n\r\nידיות ארגונומיות בגימור Soft Touch מבודדות חום, נעימות למגע ובטוחות לשימוש.\r\nהמארז כולל:\r\nסוטז 28 ס\"מ\r\nמחבת 28 ס\"מ','1661165014-3498c862-2fbd-9ae3-6694-7623bace65f5.jpeg',350,378,'שווי החלפה: 899','[\"1661165003-56793abf-f3ec-4aa8-7c3c-28d2cc177d62.jpeg\"]','2022-08-22 13:43:34',NULL),(1410,'387c0293-d45e-287b-fc40-4fe04e02b790',35,'סיר קוסקוס + מכסה נירוסטה סולתם','סיר הקוסקוס 7+12 ליטר 28ס\"מ עשוי נירוסטה פלדת אל חלד 18/10.\r\nתחתית הסיר עשויה 3 שכבות המוצמדות בטכנולוגיית היצור המתקדמת ביותר בעולם: Impact bonding המקנה חוזק מרבי לתחתית ומאפשרת פיזור חום אחיד.\r\nמכסה הסיר עשוי מפלדת אל חלד 18/10 עם כפתור בקליט, ידיות הסיר עשויות מבקליט שחור איכותי.\r\nסיר עליון – סיר מסננת אידוי עשויה נירוסטה עם חורים לאידוי הקוסקוס.\r\nהסיר מתאים לשימוש בכל סוגי הכיריים כולל אינדוקציה, לשימוש בתנור עד לטמפרטורה של 150 מעלות.\r\nמתאים לשימוש במדיח הכלים.','1661165153-490d8fab-a113-71a2-9c2a-6f1ee3cfb184.jpg',350,3