ר\r\n(פוך סינטטי ) סיבי הולפייבר הם סיבים מחוררים\r\nהכולאים ושומרים את האוויר החם בתוכם השמיכה\r\nשומרת על חום השמיכה אל-אלרגית, תפורה בקוביות\r\nניתנת לכביסה במכונה','1661422134-8e1be792-ec0f-a7df-1bef-cb8be63030bf.jpeg',150,200,'אין','[]','2022-08-25 13:08:54','2022-08-25 13:09:03'),(1421,'5bee8b84-d750-3581-8c71-d022b98f5ad1',36,'סט מצעים 100% כותנה יחיד דגם אפור בהיר yard&co','רכב בד 100% כותנה איכותית ורכה. הסט פותח עיצובית את חדר השינה, נותן אור והרגשה נעימה. מאוד מומלץ בסדרת\r\nה Mix&Match להזמין צבע נוסף לבחירתכם לדוגמא: עם הסט האפור להזמין גם סט שחור או לבן חלק ואז אפשר לשלב צבעים,\r\nדוגמא: סדין שחור וציפיות לכריות אפורות, עם ציפה לבנה חלקה ואפשר לשים גם ארבע ציפיות זוג אפור וזוג שחור, עיצוב מושלם\r\nמידות:\r\nסדין:90/200\r\nציפה: 150/200\r\nציפית:50/70','1661422708-5a7fbefc-b318-37ad-ac62-2d5b88ce006d.jpeg',150,200,'אין','[]','2022-08-25 13:18:28','2022-08-25 13:18:49'),(1422,'a41320de-50b0-7de0-77e6-5ff4b30dce24',36,'סט מצעים 100% כותנה יחיד דגם אפור כהה yard&co','הרכב בד 100% כותנה איכותית ורכה. הסט פותח עיצובית את חדר השינה נותן אור והרגשה נעימה.\r\nמאוד מומלץ בסדרת ה Mix&Match להזמין צבע נוסף לבחירתכם לדוגמא: עם הסט האפור להזמין\r\nגם סט שחור או לבן חלק ואז אפשר לשלב צבעים, דוגמא: סדין שחור וציפיות לכריות אפורות, עם ציפה\r\nלבנה חלקה ואפשר לשים גם ארבע ציפיות זוג אפור וזוג שחור, עיצוב מושלם!\r\nמידות:\r\nסדין:90/200\r\nציפה: 150/200\r\nציפית:50/70','1661422859-cf168108-8a01-eb1d-005c-520c62ff6c48.jpeg',150,200,'אין','[\"1661422858-96184f0b-832c-1e6d-2971-da0505dd122e.jpeg\"]','2022-08-25 13:20:59','2022-08-25 13:21:32'),(1423,'0bcddfaa-eeb1-f24d-99ae-c6175035a374',36,'כריות איכותיות yard&co','זוג כריות בד חיצוני 100% כותנה, מילוי פנימי סיבי קונפור. ניתן לכבס במכונת כביסה לא מקבל ג\'ולות וגושים. עומד בתקנים של בתי מלון 5 כוכבים.\r\nמשקל כרית אחת: 700 ג\'\r\nמידות: 50/70','1661423164-07d7bf5a-bf23-0f2e-8647-939933959359.jpeg',100,150,'אין','[]','2022-08-25 13:26:04','2022-08-25 13:26:10'),(1424,'65b7a114-b787-71b7-b5e7-356f4aee959b',36,'סט מצעים זוגי 100% כותנה yard&co','סט מצעים מעוצב בהרכב בד מפנק 100% כותנה.\r\nהדפס צבעוני ובולט המתחיל בגוון כחול חלש המתחזק\r\nעד גוון כחול חזק. הציפיות מעוטרות בכתב \'SWEET DREAMS\'.\r\nניתן לשלב עם שמיכת קיץ תואמת.\r\nסוג הבד: 100% כותנה\r\nהסט כולל: סדין 160/200 | זוג ציפיות 50/70 | ציפה 200/220','1661424172-d427dda5-aaba-f8b3-65ef-881f47191b73.jpeg',150,250,'אין','[\"1661424168-9222b7fe-3bf1-3e1d-4418-159fbfc1ce64.jpeg\"]','2022-08-25 13:42:52','2022-08-25 16:46:53');
